import PaypalTwo from './Paypal/PaypalTwo';
import styled from 'styled-components';
import mass from './image/mass.webp'

const DIV = styled.div`
    margin: 0 auto;
    border: none;
    box-shadow: 0px 0px 2px 0px;
    margin-top: 80px; 
    padding: 20px;
    max-width: 70%;
    border-radius: 20px;

    p{
        font-size: 28px;
    }
    img{
        border-radius: 10px;
    }
`
const MassComm = () => {
    return (  
        <DIV>
            <img src={mass} width = "50" alt="bucc" />
            <p>Mass Communication</p>
            <PaypalTwo />
        </DIV>
    );
}
 
export default MassComm;
